import { Row, Col } from "react-bootstrap";

const Tabs = () => {
  return (
    <Row>
      <Col className="tab-col active">
        <div className="tab">
          <h3>Wnioski do pobrania</h3>
        </div>
      </Col>
      <Col className="tab-col">
        <div className="tab" onClick="element.classList.add('active')">
          <h3>Interaktywne formularze</h3>
        </div>
      </Col>
    </Row>
  );
};

export default Tabs;
